    // Replace Markdown text with HTML
    for (size_t i = 0; i < lines.size(); ++i) {
        if (lines[i] == '\n') {
            lines[i] = '<p>';
        } else if (lines[i] == '\t') {
            lines[i] = '<strong>';
        } else if (lines[i] == '\t\n') {
            lines[i] = '</p>';
