Normalizing a vector is the process of scaling it to have a magnitude (length) of 1 while preserving its direction. This is often done in various fields such as linear algebra, physics, computer graphics, and machine learning. Here's how you can normalize a vector in several common programming languages:

### Python
```python
import math

def normalize_vector(vector):
    magnitude = math.sqrt(sum([x ** 2 for x in vector]))
    if magnitude == 0:
        raise ValueError("Cannot normalize a zero vector")
    return [x / magnitude for x in vector]

# Example usage:
vector = [3, 4]
normalized_vector = normalize_vector(vector)
print(normalized_vector)
```

### JavaScript
```javascript
function normalizeVector(vector) {
    const magnitude = Math.sqrt(
        vector[0] ** 2 +
        vector[1] ** 2 +
        vector[2] ** 2
    );
    if (magnitude === 0) {
        throw new Error("Cannot normalize a zero vector");
    }
    return [
        vector[0] / magnitude,
        vector[1] / magnitude,
        vector[2] / magnitude
    ];
}

// Example usage:
let vector = [3, 4, 0];
let normalizedVector = normalizeVector(vector);
console.log(normalizedVector);
```

### C++
```cpp
#include <cmath>
#include <vector>

std::vector<double> normalizeVector(const std::vector<double>& vector) {
    double magnitude = std::sqrt(std::pow(vector[0], 2) + std::pow(vector[1], 2) + std::pow(vector[2], 2));
    if (magnitude == 0) {
        throw std::invalid_argument("Cannot normalize a zero vector");
    }
    return { vector[0] / magnitude, vector[1] / magnitude, vector[2] / magnitude };
}

// Example usage:
std::vector<double> vector = {3, 4, 0};
std::vector<double> normalizedVector = normalizeVector(vector);
```

### MATLAB
```matlab
function normalizedVector = normalizeVector(vector)
    magnitude = norm(vector);
    if magnitude == 0
        error('Cannot normalize a zero vector');
    end
    normalizedVector = vector / magnitude;
end

% Example usage:
vector = [3, 4, 0];
normalizedVector = normalizeVector(vector);
disp(normalizedVector);
```

### General Steps for Normalizing a Vector
1. **Calculate the magnitude** of the vector, which is the square root of the sum of the squares of its components.
2. **Check if the magnitude is zero** to avoid division by zero.
3. **Normalize each component** of the vector by dividing each component by the magnitude.

